import React, { useState } from 'react'
import Card from 'react-bootstrap/Card';
import { details1, details2, details3 } from './details';

const Contact = () => {

    return (
        <>
            {
                details1.map((detail, index) => {
                    return (
                        <div style={{ margin: '80px' }} key={index}>
                            <h4>{detail.title} Coordinator</h4>
                            <Card bg='white' style={{ width: '18rem' }} className="mb-2">
                                <Card.Body>
                                    <Card.Title>Name: {detail}</Card.Title>
                                    <Card.Text>
                                        <h5>Contact Details:</h5> <br></br>
                                        <span>6304848405</span>
                                    </Card.Text>
                                </Card.Body>
                            </Card>
                        </div >
                    )
                })
            }
        </>

    )
}

export default Contact
